        raise ValueError("StartsOneEnds only accepts positive integers.")
    return sum(1 for _ in range(n - 1) if n % _ == 0)

def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    return sum(map(lambda x: (x[0] == 1) ^ (x[1] == 1), range(n)))
